    this.state = {
      dogs: [],
      selectedBreed: null,
      greeting: 'Select a dog breed.',
      isLoading: true
    }; //state
  } //constructor

componentDidMount() {
    axios.get(`https://dog.ceo/api/breeds/list/all`)
      .then(res => {
        const dogs = res.data;
        this.setState({ dogs });
        console.log("Printing " + this.state.dogs);
      })
